interface IconMarketProps {
  icon?: string;
  sx?: any;
  size?: "small" | "medium" | "large";
}

const small = 1.2;
const medium = 2;
const large = 3;

const IconMarket: React.FC<IconMarketProps> = ({
  icon,
  sx,
  size = "small",
}) => {
  switch (icon) {
    case "coto":
      return <CotoIcon size={size} />;
    case "dia":
      return <DiaIcon size={size} />;
    case "carrefour":
      return <CarrefourIcon size={size} />;
    case "vea":
      return <VeaIcon size={size} />;
    case "disco":
      return <DiscoIcon size={size} />;
    case "jumbo":
      return <JumboIcon size={size} />;
    default:
      return <StorefrontIcon />;
  }
};

